import { createRouter, createWebHistory } from 'vue-router'
import HomeView from '../views/HomeView.vue'
import RestoranView from '../views/RestoranView.vue'
import LoginView from '../views/LoginView.vue'
import AdminView from '../views/AdminView.vue'
import MenadzerView from '../views/MenadzerView.vue'
import RegisterView from '../views/RegisterView.vue'
import ProfilView from '../views/ProfilView.vue'
import KreirajMenadzeraView from '../views/KreirajMenadzeraView.vue'
import KreirajDostavljacaView from '../views/KreirajDostavljacaView.vue'
import KreirajRestoranView from '../views/KreirajRestoranView.vue'
import ObrisiRestoranView from '../views/ObrisiRestoranView.vue'
import IzaberiMenadzeraView from '../views/IzaberiMenadzeraView.vue'
import ArtikalView from '../views/ArtikalView.vue'
import PorudzbinaView from '../views/PorudzbinaView.vue'
import ArtikalDodajView from '../views/ArtikalDodajView.vue'
import KupacView from '../views/KupacView.vue'
import DostavljacView from '../views/DostavljacView.vue'
import PregledKorpeView from '../views/PregledKorpeView.vue'
import KomentarView from '../views/KomentarView.vue'
import ImageView from '../views/ImageView.vue'


const routes = [
  {
    path: '/',
    name: 'home',
    component: HomeView
  },
  {
    path: '/image',
    name: 'Image',
    component: ImageView
  },
  {
    path: '/komentar',
    name: 'Komentar',
    component: KomentarView
  },
  {
    path: '/pregled-korpe',
    name: 'PregledKorpe',
    component: PregledKorpeView
  },
  {
    path: '/artikal-dodaj',
    name: 'ArtikalDodaj',
    component: ArtikalDodajView
  },
  {
    path: '/dostavljac',
    name: 'Dostavljac',
    component: DostavljacView
  },
  {
    path: '/kupac',
    name: 'Kupac',
    component: KupacView
  },
  {
    path: '/artikal',
    name: 'Artikal',
    component: ArtikalView
  },
  {
    path: '/porudzbina',
    name: 'Porudzbina',
    component: PorudzbinaView
  },
  {
    path: '/izaberi-menadzera',
    name: 'IzaberiMenadzera',
    component: IzaberiMenadzeraView
  },
  {
    path: '/obrisi-restoran',
    name: 'ObrisiRestoran',
    component: ObrisiRestoranView
  },
  {
    path: '/kreiraj-restoran',
    name: 'KreirajRestoran',
    component: KreirajRestoranView
  },
  {
    path: '/kreiraj-dostavljaca',
    name: 'KreirajDostavljaca',
    component: KreirajDostavljacaView
  },
  {
    path: '/kreiraj-menadzera',
    name: 'KreirajMenadzera',
    component: KreirajMenadzeraView
  },
  {
    path: '/profil',
    name: 'Profil',
    component: ProfilView
  },
  {
    path: '/register',
    name: 'register',
    component: RegisterView
  },
  {
    path: '/login',
    name: 'login',
    component: LoginView
  },
  {
    path: '/menadzer',
    name: 'menadzer',
    component: MenadzerView
  },
  {
    path: '/admin',
    name: 'admin',
    component: AdminView
  },
  {
    path: '/restoran',
    name: 'restoran',
    component: RestoranView
  }
]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})

export default router
